import React from "react";
import Button from "react-bootstrap/Button";
import "../index.css";

export default class Coaching extends React.Component {
  /* cards: 
  - Programming
    - Individualized program taylored to your goals and training history
    - Auto-regulated (RPE) to account for good and bad days in the gym. 
    - Data-driven approach
    - Evidence-based injury risk reduction and management 
  - Powerlifting, img 
    - Specalize in the Squat, Bench, Deadlift 
    - C
  - Strength and Conditioning
    - Meet exercise guidelines for health
    - Improve quality of life 
    - */

  render() {
    return (
      <div>
        This is my deadlift face. Clever transition... Something of a coaching
        resume Get coaching from this pretty face {"->"}
        <p>Powerlifting </p>
        <p>Pain/injury </p>
        <p>Training philosophy</p>
        <p>Health/fitness</p>
      </div>
    );
  }
}
